import { v4 as uuidv4 } from 'uuid';

const initialProgramId = uuidv4();
const initialWorkoutId = uuidv4();

export const initialState = {
  program: {
    user_id: 2,
    tempId: initialProgramId,
    name: 'New Program',
    program_duration: 0,
    duration_unit: 'Days',
    days_per_week: 0,
    main_goal: 'Strength',
    isNew: true,
    workouts: {
      [initialWorkoutId]: {
        tempId: initialWorkoutId,
        name: 'Workout 1',
        order: 1,
        exercises: [],
        isNew: true
      }
    }
  },
  activeWorkout: initialWorkoutId,
  selectedProgram: initialProgramId
};
